<html><head><title>New Tab!</title><link rel="stylesheet" href="style.css"/><script src="angular.min.js"></script><script src="all.min.js"></script></head><body ng-app="newtab" ng-csp="ng-csp"><div class="city"></div><div class="scratches"></div><div ng-repeat="pass in [1,2]" class="ui"><div ng-controller="CPUCtrl" class="cpu-info"><div class="model-name">CPU STATUS - NOMINAL<br>{{info.modelName}}</div><div ng-repeat="processor in info.processors track by $index" class="processor"><div class="bar"><div ng-style="processorStyle($index)" class="inner"></div></div></div></div></div></body></html>
